import React from "react";

const Card = ({ name, image, price, bookNowLink }) => {
  const handleBookNow = (link) => {
    window.open(link, "_blank"); // Opens the link in a new tab
  };

  return (
    <div className="card">
      <div className="top">
        <div className="circle-img">
          <img src={image} alt="Profile" className="circle-img" />
        </div>
        <div className="name">
          <span>{name}</span>
        </div>
      </div>
      <div className="bottom">
        <div>{price}</div>
        <button onClick={() => handleBookNow(bookNowLink)}>Book Now</button>
      </div>
    </div>
  );
};

export default Card;
